"use strict";

function f_gold(capacity, rocks, additionalRocks) {
    let d = capacity.map((val, idx) => val - rocks[idx]);
    d.sort((a, b) => a - b);
    let ans = 0;
    for (let v of d) {
        if (v <= additionalRocks) {
            ans += 1;
            additionalRocks -= v;
        }
    }
    return ans;
}
